This package contains a first Portable version built using RunHiddenConsole.exe to start the Batch file that changes some values in Registry, runs the program and deletes the Registry values when exiting from the program. Some AVs complain with it recognizing RunHiddenConsole.exe as a malicious/potentially harmful program as it can be used to hide malicious behaviours. If it&amp;#039;s your case, or just don&amp;#039;t trust in the first one, use the second version that runs the batch file directly, you will have the sloppy DOS window in the background but less complaints from antiviruses.



Enjoy and remember to seed.... :o)
